import React, { Component } from 'react';

class Page1 extends Component {

    handleScroll=()=>{
        window.scroll({top:0,behavior:'smooth'})
    
    }
    componentDidMount() {
        this.handleScroll()
  }
    render() {
        return (
            <div className="sheet">
                 <h1 id="p1title" className="bold center">Peer mentoring session 13</h1>
                <div id="page1" className="left">
                    <div className='container_for_medium_margin'>
                        
                    </div>
                    <div>
                        <h1 id="purpose" className="bold">Purpose</h1>
                        <ul>
                            <li className="li">Work on your mentee's third coping strategy </li>
                            <li className="li">Review other possible coping strategies</li>
                            <li className="li">Talk about what coping strategies would be good to use in different places</li>
                        </ul>
                    </div>
                    <br /><br />
                    <div>
                        <h1 id="Materials" className="bold">Materials</h1>
                        <ul>
                            <li className="li">Peer mentoring script</li>
                            <li className="li">Body scan worksheet link</li>
                            <li className="li">Mood log</li>
                            <li className="li">Coping strategy toolkit</li>
                        </ul>
                    </div>
                </div>
            </div>
        )
    }
    
}

export default Page1;
